/** @format */

import { NavLink } from "react-router-dom";

const Nav = ({ names }) => {
  names.map((n) => {
    return console.log(n);
  });
  return (
    <nav>
      <NavLink exact to="/dogs">
        Home
      </NavLink>
      {names.map((n) => {
        return (
          <NavLink exact to={`/dogs/${n.toString().toLowerCase()}`}>
            {n}
          </NavLink>
        );
      })}
    </nav>
  );
};

export default Nav;
